import React, { Component } from 'react';
//引入组件
import { Table, Tag, Space } from 'antd';

//引入css文件
import './style.css';

const { Column, ColumnGroup } = Table;

const data = [
    {
        key: '1',
        touchEvents: 'John',
        totalClicks: 'Brown',
        clickRate: 32,
        durationDistr: 'New York No. 1 Lake Park',
        stepLengthDistr: ['nice', 'developer'],
        valueRealization:'valueRealization',
        contributionRate:'contributionRate'
    },
    {
        key: '1',
        touchEvents: 'John',
        totalClicks: 'Brown',
        clickRate: 32,
        durationDistr: 'New York No. 1 Lake Park',
        stepLengthDistr: ['nice', 'developer'],
        valueRealization:'valueRealization',
        contributionRate:'contributionRate'
    },
    {
        key: '1',
        touchEvents: 'John',
        totalClicks: 'Brown',
        clickRate: 32,
        durationDistr: 'New York No. 1 Lake Park',
        stepLengthDistr: ['nice', 'developer'],
        valueRealization:'valueRealization',
        contributionRate:'contributionRate'
    },
    {
        key: '1',
        touchEvents: 'John',
        totalClicks: 'Brown',
        clickRate: 32,
        durationDistr: 'New York No. 1 Lake Park',
        stepLengthDistr: ['nice', 'developer'],
        valueRealization:'valueRealization',
        contributionRate:'contributionRate'
    },
    {
        key: '1',
        touchEvents: 'John',
        totalClicks: 'Brown',
        clickRate: 32,
        durationDistr: 'New York No. 1 Lake Park',
        stepLengthDistr: ['nice', 'developer'],
        valueRealization:'valueRealization',
        contributionRate:'contributionRate'
    },
    {
        key: '1',
        touchEvents: 'John',
        totalClicks: 'Brown',
        clickRate: 32,
        durationDistr: 'New York No. 1 Lake Park',
        stepLengthDistr: ['nice', 'developer'],
        valueRealization:'valueRealization',
        contributionRate:'contributionRate'
    },
    {
        key: '1',
        touchEvents: 'John',
        totalClicks: 'Brown',
        clickRate: 32,
        durationDistr: 'New York No. 1 Lake Park',
        stepLengthDistr: ['nice', 'developer'],
        valueRealization:'valueRealization',
        contributionRate:'contributionRate'
    },
    {
        key: '1',
        touchEvents: 'John',
        totalClicks: 'Brown',
        clickRate: 32,
        durationDistr: 'New York No. 1 Lake Park',
        stepLengthDistr: ['nice', 'developer'],
        valueRealization:'valueRealization',
        contributionRate:'contributionRate'
    },
    {
        key: '1',
        touchEvents: 'John',
        totalClicks: 'Brown',
        clickRate: 32,
        durationDistr: 'New York No. 1 Lake Park',
        stepLengthDistr: ['nice', 'developer'],
        valueRealization:'valueRealization',
        contributionRate:'contributionRate'
    }
    
];

class ReasultShow extends Component {

    showColumn = () => {
        return (
            <>
                <ColumnGroup title="待归因事件">
                    <Column title="触点事件" dataIndex="touchEvents" key="touchEvents" />
                </ColumnGroup>
                <ColumnGroup title="点击规模">
                    <Column title="总点击数" dataIndex="totalClicks" key="totalClicks" />
                    <Column title="有效点击率" dataIndex="clickRate" key="clickRate" />
                </ColumnGroup>
                <ColumnGroup title="转化分布">
                    <Column title="转化时长分布" dataIndex="durationDistr" key="durationDistr" />
                    <Column title="转化步长分布" dataIndex="stepLengthDistr" key="stepLengthDistr" />
                </ColumnGroup>
                <ColumnGroup title="目标转化">
                    <Column title="实现价值" dataIndex="valueRealization" key="valueRealization" />
                    <Column title="贡献率" dataIndex="contributionRate" key="contributionRate" />
                </ColumnGroup>
            </>
        )
    }

    render() {
        return (
            <Table
                bordered= {true}
                dataSource={data}
                className='reasult'
                pagination={true}
            >
                {this.showColumn()}
            </Table>
        )
    }
}

export default ReasultShow;
